import React from "react";

const Nav = () =>{
    return (
        <div className="w-7xl">
            <div>
                <h2 className="text-2xl font-semibold">Подтягивайте знание</h2>
                <h1>Доступно и эффективно</h1>
                <p>SDU Assistant - образовательная платформа для студентов СДУ, который поможет подтянуть знание в любое удобное время и достичь успеха.</p>
            </div>
            <div>

            </div>
        </div>
    );

}

export default Nav;
